import React from "react";

function Navbar() {
	const onPress = (e) => {
		e.preventDefault();
		
		const target = window.document.getElementById(
		  e.currentTarget.href.split("#")[1]
		);
		console.log(target);
		if (target) {
			console.log(target);
		  target.scrollIntoView({ behavior: "smooth" });
		}
	  };
	 
        return (
            <div className="container-fluid navigation_bar">
			<nav className="navscroll navbar fixed-top navbar-expand-lg navbar-light py-2 px-3"  id="navbar-example2" >
				<div className="container">
                <div className="navbar-brand point_color">Portfolio</div>
				  <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
				    <span className="text-white"></span>
				  </button>
				  <div className="collapse navbar-collapse" id="navbarSupportedContent">
				    <ul className="navbar-nav ms-auto nav nav-pills">
				      <li className="nav-item my-1 align-start me-4">
					  <a className="" onClick={(e) => onPress(e)} href="#scrollspyHeading1" id="nav1"><span className="d-lg-none d-xl-none me-3"></span>Home</a>
				      </li>
				      <li className="nav-item my-1 me-4">
					  <a className="" onClick={(e) => onPress(e)} href="#scrollspyHeading2" id="nav2"><span className="d-lg-none d-xl-none me-3"></span>Skills</a>
				      </li>
				      <li className="nav-item my-1 me-4">
					  <a className=""  onClick={(e) => onPress(e)} href="#scrollspyHeading3" id="nav3"><span className="d-lg-none d-xl-none me-3"></span>Projects</a>
				      </li>
				      <li className="nav-item my-1 me-4">
					  <a className=""  onClick={(e) => onPress(e)} href="#scrollspyHeading4"><div id="nav4"><span className="d-lg-none d-xl-none me-3"></span>About</div></a>
				      </li>					 
				    </ul>
				  </div>
				</div>
			</nav>
		</div>
        )
    
}

export default Navbar;
